class KeyInfo{
    String name, korname, ttsname;
    Image img;
    boolean ltr;
    String [][] keys, deadkeys;
    int deadcnt;
    
    public KeyInfo(String ttsname, String name, String korname, boolean ltr,
            String img, String [][] keys, int deadcnt, String [][] deadkeys)
    {
        this.ttsname = ttsname;
        this.name = name;
        this.korname = korname;
        this.ltr = ltr;

       /*
        * [0] - IS RESPONSE with !CAPSLOCK(0), CAPSLOCK(1), SGCap(2)
        * [1] - 기본 상태(n)
        * [2] - Shift 눌러짐(s)
        * [3] - 'l' state
        * [4] - Ctrl+Alt 눌러짐(t)
        * [5] - 'f' state
        * [6] - 'y' state
        * [7] - 'z' state
        */
        this.img = new Image(getClass().getResourceAsStream("image/" + img));
        this.keys = keys;
        this.deadcnt = deadcnt;

       /* [0] - special key (k)
        * [1] - normal key (b)
        * [2] - combined key (c)
        */
        this.deadkeys = deadkeys;
    }
}
